{'time': 1574306772577, 'text': 'Thank you for being our guest at Extended Stay America. We are delighted to read that we met your expectations. Feedback such as yours inspires and motivates our team to continue delivering exceptional service, and we hope you will choose us every time your travels bring you to Chicago.

Sincerely,
Hotel Management'}

{'time': 1556408983075, 'text': "A,

Thank you for the feedback regarding the restrooms.  We will make more of an effort to ensure that they are clean throughout the day for our customers.  I'm sorry you were not wowed by the food.  Our veggies are just steamed- we do not season them at all, but will happily provide whatever you need to make them just right for you.  We hope to see you again soon!

-Drew"}

{'time': 1562554655456, 'text': 'Michael, thank you for the awesome review! We hope to see you again soon!

-Billy.
william.russ@4cbars.com'}

{'time': 1617634235114, 'text': "Thank you so much for this great 5-star review, Venessa.  We really appreciate you being a loyal customer and helping to share the word about us.  We're here for you anytime!

Cheers,
Rosen Hyundai of Algonquin"}

{'time': 1593618318100, 'text': '(Translated by Google) Thanks for your comments, Cris. We appreciate you buying from us.

(Original)
Gracias por tus comentarios, Cris. Le agradecemos que compre con nosotros.'}

{'time': 1519222643606, 'text': 'Oh yes! Glad you enjoyed Theresa!

Thank you,

Joseph and The Orange Team!'}

{'time': 1559169936214, 'text': '(Translated by Google) Hello Beatriz, thanks for the good criticism. Hopefully and visit us again very soon! - HCA

(Original)
